import React,{Component} from 'react';
import 'tachyons';
import './Nav.css';
import Home from './home.js';
import Work from './work.js';
import Contact from './contact.js';


class Nav extends Component {
  constructor() {
    super();
  }
  render(){
    return (
      <div>
      <div className="Home" style={{backgroundcolor:'black'}}>
      <div className="topnav">
       <h5 className="head mt-3">  Debugged.exe </h5>
       &nbsp;
       <ol className="navhead" type="1">
        <li  className="nav f4" onClick={<Home/>}>About us</li>
        <li  className=" nav f4"  onClick={<Work/>}>Our work</li>
        <li  className=" nav f4"  onClick={<Contact/>}>Contact us</li>
       </ol>
       </div>
     </div>
     </div>

    );
  }
}

export default Nav;
